('1000270', 'Sosio Konsepsia: Jurnal Penelitian dan Pengembangan Kesejahteraan Sosial', 'Herien Puspitawati', 'Herien Puspitawati adalah staf pengajar di Departemen llmu Keluargo don Konsumen, Fakultas Ekologi Manusia, lnstitut Pertanian Bogar dan juga Tim Pakar Gender Departemen Pendidikan Nasional-RI. Menamatkan gelar Sarjana di Bidang Agribisnis dari lnstitut Pertanian Bogor pada Tahun 1985, kemudion menamatkan gelar Master di Bidang Family Environment dari Department of Human Development and Family Studies dari Iowa State University-USA pada Tahun 1992, dan menamatkan gelar Master lagi di Bidang Family Sociology dari Department of Sociology dari Iowa State University-USA pada Tahun 1998. Akhirnya penulis menamatkan gelar Doktor di Bidang Gizi Masyarakat dan Sumberdaya Keluarga, Fakultas Pertanian , lnstitut Pertanian Bogor pada Tahun 2006.', '1990'),
('1000270', 'Sosio Konsepsia: Jurnal Penelitian dan Pengembangan Kesejahteraan Sosial', 'Tin Herawati', 'Tin Herawati adalah Pengajar di Departemen llmu Keluarga don Konsumen, Fakultas Ekologi Manusia, lnstitut Pertanian Bogor dan juga Mahasiswa Program Doktor di PS Penyuluhan Pembangunan-FEMA-IPB. Tin Herawati menamatkan gelar Sarjana di Bidang Gizi Masyarakat don Sumberdaya Keluarga, Fakultas Pertanian , lnstitut Pertanian Bogor pada Tahun 1997, kemudian menamatkan gelar Master di bidang dan perguruan tinggi yang sama Tahun 2003.', '1990'),
('1000270', 'Sosio Konsepsia: Jurnal Penelitian dan Pengembangan Kesejahteraan Sosial', 'Ma\'mun Sarma', 'Ma\'mun Sarma adalah staf Pengajar di Departemen Manojemen, Fakultos Ekonomi don Manajemen, lnstitut Pertanian Bogor. Menamatkan gelar Sarjana di Bidang Agribisnis dari lnstitut Pertanian Bogor\r\npada Tahun 1981, kemudian menamatkan gelar Master di Bidang Ekonomi Pertanian dari\r\nlnstitut Pertanian Bogor pada Tohun 1986. Penulis kemudian menamatkan kembali gelar\r\nMaster di Bidang Agricultural Economics dari the University of New South Wales, Australia\r\npada Tahun 1990. Akhirnya penulis menamatkan gelar Doktor di Bidang Forestry Economics don Agricultural Extention and Education dari Iowa State University-USA pado Tahun 1998.', '1990'),
