('1001145', 'Sosio Konsepsia: Jurnal Penelitian dan Pengembangan Kesejahteraan Sosial', 'Sugiyanto Sugiyanto', 'Sugiyanto, S.Pd.,M.Si., lahir di Tawangharjo 8 Januari 1961. Magister Sains Program Studi\r\nIlmu Administrasi Konsentrasi Administrasi dan Kebijakan Publik, Kekhususan Pengembangan\r\nMasyarakat (S2), diperoleh dari Universitas Muhammadiyah Jakarta (2005) dan S1 (Sarjana\r\nPendidikan Moral Pancasila dan Kewargaan Negara) diperoleh dari Sekoloh Tinggi Pendidikan\r\nllmu Pengetahuan Sosial (STPIPS) YAPSI Jayapura (1994). Jabatan peneliti : Peneliti Muda Bidang\r\nKesejahteraan Sosial di Pusat Penelitian dan Pengembangan Kesejahteraan Sosial, Badan\r\nPendidikan dan Penelitian Kesejahteraan Sosial, Deportemen Sosial RI. Aktif mengikuti kegiatan\r\npenelitian bidang kesejahteraan sosial, don berbagai seminar permasalahan sosial di Indonesia.\r\nBeberapa hasil penelitiannya telah diterbitkan, baik secara mandiri maupun kelompok, dan\r\ntulisannya pernah diterbitkan di JURNAL maupun INFORMASI.', '1994'),
