('1004522', 'Sosio Konsepsia: Jurnal Penelitian dan Pengembangan Kesejahteraan Sosial', 'Sutaat Sutaat', 'Sutaat, lahir di Tegal (1 Januari 1951 ). Pendidikan Sarjana Muda diperolehnya dari UMJ (1980),\r\nsedangkan S 1 diraihnya dari STKS Bandung (1984). la memulai karir sebagai PNS di PPA Bambu\r\nApus (1975), selanjutnya alih tugas ke Balitbang Kessos (1985). Joboton sekarong odalah Peneliti\r\nMadyo (2005-sekorang).\r\nPernoh memimpin beberopo kegioton Penelition internal (Litbong Kessos), antoro loin yoitu: (1)\r\nPartisiposi mosyarokat Koto dolom Mengotosi Mosolah Sosial Pasco Krisis (2003), (2) Persepsi\r\nLegislotif Dolam Pembongunon Kesejohteroon Sosiol (2004).\r\nKegioton penelition internal (Litbong Kesos) lainnya yang teloh dilakukon don dibukukan ontoro\r\nlain: (1) Priloku Remojo di Doeroh Pinggiran Kota (2004); (2) ldentifikosi Kebutuhon Pelayonon\r\nbogi Orang Dengon HIV/ AIDS (ODHA) (2003), don (3) Analisis Kebutuhon Pekerjo Sosiol di\r\nPusat Pelayanon Korbon Bencana (2003).\r\nKegiaton penelitian yang dilokukan kerjosamo dengon institusi lain, ontara lain: (l) Survey on\r\nAccessibility Problems to Pontis and Voca tional Rehabilitation Service ofter Decentralization in Indonesia\r\n(yoyoson Kondidot, 2003), (2) Kajion Mogement Kessos Ponti Sosiol OKI Jakarta (YASHINTHA,\r\n2002), (3) Ketohonon Sosiol Mosyorakat Daerah Perkotaan (Pusbong Tonsosmas, 2002), (4)\r\nStudi Persiapon Doeroh dalom Pelaksonoan Strotegi don Peloyonon Sosiol bagi Anjol (YASHINTHA,\r\n2002), don (5) Tongg~ng Jowob Sosial lndustri (Kantor MASKAT, 2000) .', '2000'),
