('1009837', 'Perspektif', 'Agus Budi Susilo', 'Agency or Officer in the state administration (office of the state administration) has broad authority in conducting the affairs of government (executive). With this broad authority tend to abuse that caused harm and injustice in the society, therefore there must be other institutions that control it. Based on the theory of triad politics of the executive is politically controlled by the legislative and juridical institutions controlled by the judiciary, because the state administration officials running the executive functions that control the judiciary is legally the state administrative court. Judicial control by the state administrative court is currently under Law No. 51 of 2009 (second amendment) and Law No. 9 of 2004 (first change) is revising the Law No. 5 of 1986 concerning the Administrative Court only in the case of administrative provisions (beschikking ) issued by the agency or official of the state administration alone, whereas the absolute competence philosofis state administrative court is to settle disputes in a broad sense the state administration. Therefore based views need to be explored further futuristic law to be revised, especially about the meaning of the state administrative disputes in the form of legal action by the office of public administration in violation of state law. All this is nothing else aims to reposition the nature of administrative enforcement by the courts and simplify state administration (efficiency and effectiveness) of all state administrative dispute resolution has been done by a civil court (for example, state administrative disputes regarding intellectual property rights and labor) and special courts (eg tax disputes) to the absolute authority of the state administrative court.', '2004'),
