('1011353', 'Sosio Konsepsia: Jurnal Penelitian dan Pengembangan Kesejahteraan Sosial', 'Yanuar Farida Wismayanti', 'Yanuar Farida Wismayanti : Penulis adalah peneliti di Pusat Penelitian dan Pengembangan Kesejahteraan Sosial, Kementerian Sosial RI. Sebelum bergabung di Kemensos tahun 2005, penulis pernah menjadi relawan pada sebuah LSM Anak “Bahtera” di Kota Bandung, dan tahun 2000 bergabung di Plan International Surabaya, sebagai Community Transformation Agent (CTA) di Kabupaten Gunung Kidul-DIY, kemudian menjadi Childhelpline Project Officer  dan terakhir sebagai CNSP (Children in Need Special Protection) Project officer untuk Kota Surabya. Tulisan ini, sebagian dari tesisnya di Program Pasca Sarjana Antropologi Universitas Gadjah Mada, berjudul Dunia Kecil yang Kujalani: Jejak Anak Perempuan yang Dilacurkan di Kota Surabaya, tahun 2010. Email : yanuarwismayanti@gmail.com', '2005'),
